import React from "react";

function Row(props) {
    return (
        <tr>
        <td>{props.img}</td>
        <td>{props.firstName}</td>
        <td>{props.lastName}</td>
        <td>{props.email}</td>
      </tr>
    )
  }

  export default Row;
